import react from "react";

function SearchBox() {

  return (
    <div>
      <script src = "./script.js"></script>
      <div className="App">
        Zip Code: <input type="text" id="textBox"></input>
        <button className="button" onClick={() => {
          let userZip = document.getElementById("textBox").value();

          let jsonResponse = fetch("http://ctp-zip-api.herokuapp.com/zip/" + userZip);
          let parsedJson = JSON.parse(jsonResponse);
          console.log(parsedJson);

        }
        }>Submit</button>
      </div>
    </div>
  );
}

export default SearchBox;
